import React, { useEffect, useState } from "react";
import { useParams, Link } from "react-router-dom";
import { Diff, Hunk, parseDiff } from "react-diff-view";
import "react-diff-view/style/index.css"; // Import default styles

export default function PRDetails() {
  const { owner, repo, number } = useParams();
  const [prDetails, setPrDetails] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchPRDetails = async () => {
      const token = localStorage.getItem("authToken");
      if (!token) {
        setError("No authentication token found.");
        setLoading(false);
        return;
      }

      try {
        const res = await fetch(
          `http://localhost:5001/github/repos/${owner}/${repo}/pulls/${number}/details`,
          {
            headers: { Authorization: `Bearer ${token}` },
          }
        );

        if (!res.ok) {
          throw new Error(`Failed to fetch PR details: ${res.status}`);
        }

        const data = await res.json();

        if (data.details) {
          setPrDetails(data);
        } else {
          setPrDetails(data);
        }
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchPRDetails();
  }, [owner, repo, number]);

  if (loading) {
    return <p className="text-center mt-5">Loading PR details...</p>;
  }

  if (error) {
    return <p className="text-center text-danger mt-5">{error}</p>;
  }

  if (!prDetails) {
    return <p className="text-center mt-5">No details found for this PR.</p>;
  }

  return (
    <div className="container py-4">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>
          PR #{prDetails.details.number}:{" "}
          <span className="text-primary">{prDetails.details.title}</span>
        </h2>
        <Link to={`/repos/${owner}/${repo}/prs`} className="btn btn-secondary">
          â¬… Back to PR List
        </Link>
      </div>

      <p>
        <strong>State:</strong>{" "}
        {prDetails.details.state ? (
          <span
            className={`badge ${
              prDetails.details.state === "open" ? "bg-success" : "bg-secondary"
            }`}
          >
            {prDetails.details.state.toUpperCase()}
          </span>
        ) : (
          <span className="badge bg-warning text-dark">UNKNOWN</span>
        )}
      </p>
      <p>
        <strong>Author:</strong> {prDetails.details.user?.login || "N/A"}
      </p>
      <p>
        <strong>Created At:</strong>{" "}
        {prDetails.details.created_at
          ? new Date(prDetails.details.created_at).toLocaleString()
          : "N/A"}
      </p>
      <p>
        <strong>Updated At:</strong>{" "}
        {prDetails.details.updated_at
          ? new Date(prDetails.details.updated_at).toLocaleString()
          : "N/A"}
      </p>
      <hr />
      <h4>Description</h4>
      <p>{prDetails.details.body || "No description provided."}</p>

      <hr />
      <h4>Files Changed</h4>
      {prDetails.files.length === 0 && <p>No files changed.</p>}

      {prDetails.files.map((file) => {
        const diffText = `diff --git a/${file.filename} b/${file.filename}\n${file.patch}`;
        const files = parseDiff(diffText);

        return (
          <div key={file.filename} className="mb-4">
            <h5>{file.filename}</h5>
            <Diff viewType="unified" diffType="modify" hunks={files[0].hunks}>
              {(hunks) =>
                hunks.map((hunk) => <Hunk key={hunk.content} hunk={hunk} />)
              }
            </Diff>
          </div>
        );
      })}
    </div>
  );
}
